INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300148, 9, 1, 1, 1, 0.0, 0, "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！", 1, 5, 2, "vo_minigame_1012_result_1080", 3001);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300149, 9, 8, 1, 1, 2.21, 0, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", 2, 5, 2, "vo_minigame_1012_result_1081", 3001);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300150, 9, 3, 1, 1, 2.46, 0, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 2, 5, 2, "vo_minigame_1012_result_1082", 3001);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300151, 9, 3, 1, 1, 2.94, 0, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 2, 5, 2, "vo_minigame_1012_result_1083", 3001);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300152, 9, 7, 1, 1, 4.19, 0, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 3, 5, 2, "vo_minigame_1012_result_1084", 3001);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300153, 9, 1, 1, 1, 0.0, 0, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 3, 5, 2, "vo_minigame_1012_result_1085", 3001);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300154, 9, 3, 1, 1, 2.63, 0, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 3, 5, 2, "vo_minigame_1012_result_1086", 3001);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300155, 4, 3, 1, 1, 5.53, 0, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 1, 1, 2, "vo_minigame_1012_result_1087", 3001);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300156, 4, 3, 1, 3, 0.01, 9, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 1, 1, 2, "vo_minigame_1012_result_1088", 3001);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300157, 4, 3, 1, 1, 4.15, 3, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 1, 1, 2, "vo_minigame_1012_result_1089", 3001);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300158, 4, 9, 1, 9, 0.01, 9, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 2, 1, 2, "vo_minigame_1012_result_1090", 3001);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300159, 4, 3, 1, 1, 5.37, 0, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 2, 1, 2, "vo_minigame_1012_result_1091", 3001);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300160, 4, 3, 1, 1, 1.44, 0, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 2, 1, 2, "vo_minigame_1012_result_1092", 3001);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300161, 4, 3, 1, 3, 0.0, 0, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 3, 1, 2, "vo_minigame_1012_result_1093", 3001);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300162, 4, 3, 1, 9, 2.91, 3, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 3, 1, 2, "vo_minigame_1012_result_1094", 3001);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300163, 4, 5, 1, 1, 2.61, 0, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", 3, 1, 2, "vo_minigame_1012_result_1095", 3001);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300164, 0, 4, 1, 2, 3.63, 1, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 1, 0, 2, "vo_minigame_1012_result_1096", 3001);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300165, 0, 6, 1, 2, 4.16, 1, "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？", 1, 0, 2, "vo_minigame_1012_result_1097", 3001);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300166, 0, 3, 1, 3, 0.01, 6, "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…", 1, 0, 2, "vo_minigame_1012_result_1098", 3001);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300167, 0, 6, 1, 2, 5.75, 0, "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！", 2, 0, 2, "vo_minigame_1012_result_1099", 3001);
