INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (12300170, 0, 5, 1, 3, 5.32, 1, "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！", 3, 0, 2, "vo_minigame_1012_result_1102", 3001);
